import React from 'react'
import ContentBox from './ContentBox'

function Genre() {
  return (
    <div class="box container-fluid">
      <div class="row row-cols-md-2 row-cols-1" >
        <ContentBox/>
      </div>
    </div>
  )
}

export default Genre
